  "name": "position",
  "namespace": "com.trivads",
  "doc": "This is a sample Avro schema to get you started. Please edit",
  "fields": [
    {
      "name": "id",
      "type": "string"
    },
    {
      "name": "latitude",
      "type": "double"
    },
    {
      "name": "longitude",
      "type": "double"
    }
  ]
}
"""

key_schema_str = """
{
   "namespace": "com.trivadis",
   "name": "postionKey",
   "type": "record",
   "fields" : [
     {
       "name" : "id",
